import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function AlternateAirports() {
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  const load = () => {
    axios.get('/api/alternate_airports')
      .then(r => { setData(r.data); setError(null); })
      .catch(e => setError(e.response?.data?.error || e.message));
  };

  useEffect(load, []);

  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-4">Alternate Airports</h2>

      <button
        onClick={load}
        className="mb-6 px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700 transition"
      >
        ðŸ”„ Refresh
      </button>

      {error && <p className="text-red-600 mb-4 font-semibold">Error: {error}</p>}

      <div className="overflow-x-auto">
        <table className="min-w-full border border-gray-400">
          <thead>
            <tr className="bg-gray-200 text-left text-sm uppercase font-semibold">
              <th className="border border-gray-400 px-3 py-2">City</th>
              <th className="border border-gray-400 px-3 py-2">State</th>
              <th className="border border-gray-400 px-3 py-2">Country</th>
              <th className="border border-gray-400 px-3 py-2"># Airports</th>
              <th className="border border-gray-400 px-3 py-2">Codes</th>
              <th className="border border-gray-400 px-3 py-2">Names</th>
            </tr>
          </thead>
          <tbody>
            {data.map((a, i) => (
              <tr key={i} className="bg-white hover:bg-gray-50">
                <td className="border border-gray-300 px-3 py-2">{a.city}</td>
                <td className="border border-gray-300 px-3 py-2">{a.state || '-'}</td>
                <td className="border border-gray-300 px-3 py-2">{a.country}</td>
                <td className="border border-gray-300 px-3 py-2">{a.num_airports}</td>
                <td className="border border-gray-300 px-3 py-2">{a.airport_code_list}</td>
                <td className="border border-gray-300 px-3 py-2">{a.airport_names_list}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
